import React from 'react';
import './RecentWork.css';

function RecentWork() {
  return (
    <section className="recent-work">
      <h2>My Recent Work</h2>
      <p>Here are a few past design projects I've worked on. Want to see more? Email me.</p>
      <div className="work-grid">
        <div className="work-item">WF Design + Build</div>
        <div className="work-item">Accounting and tax services</div>
        <div className="work-item">Chronicled</div>
        <div className="work-item">GLC Solutions</div>
        <div className="work-item">Coupal</div>
        <div className="work-item">Wedler Engineering</div>
      </div>
    </section>
  );
}

export default RecentWork;
